import ReactDOM from 'react-dom';
import './assets/css/index.css';
import GLOBAL from './components/global.js';
import { BrowserRouter } from "react-router-dom";
import App from './App';


ReactDOM.render(
  <BrowserRouter>
      <App />
  </BrowserRouter>,
  document.getElementById("root")
);
